  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'AngularCRUDProducts';
  constructor(private route: ActivatedRoute){}
  ngOnInit(): void
}
